it('Ordinal', () => {
  dayjs.locale('bg')
  moment.locale('bg')

  for (let d = 1; d <= 31; d += 1) {
    const day = d < 10 ? `0${d}` : d
    const date = `2021-01-${day}`
    expect(dayjs(date).format('Do')).toBe(moment(date).format('Do'))
  }
})

